import SvgIcon from '@material-ui/core/SvgIcon';
import AdjustIcon from '@material-ui/icons/Adjust';
import { makeStyles } from '@material-ui/core/styles';
import { WIDGETS_IDS } from '../../constants'
import { primaryColor } from '../../Theme'
// Avoid defining properties with css || inline style
const useIconStyles = makeStyles(({ palette }) => ({ icon: { color: props => props.selected ? palette.primary.main : palette.common.white } }))

export default ({ widgetId, selected }) => {
  const classes = useIconStyles({ selected })
  switch (widgetId) {
  case WIDGETS_IDS.EDIT_MODE.POP_PARAMS:
    return <PopulationIcon fontSize="large" className={classes.icon}/>
  case WIDGETS_IDS.EDIT_MODE.CELL_PARAMS:
    return <CellIcon fontSize="large" className={classes.icon}/>
  case WIDGETS_IDS.EDIT_MODE.SYN_MECH_PARAMS:
    return <SynapseIcon fontSize="large" fill={selected ? primaryColor : 'white'} className={classes.icon}/>
  case WIDGETS_IDS.EDIT_MODE.CONN_PARAMS:
    return <NetworkIcon fontSize="large" className={classes.icon}/>
  case WIDGETS_IDS.EDIT_MODE.STIM_SOURCE_PARAMS:
    return <SourceIcon fontSize="large" className={classes.icon}/>
  case WIDGETS_IDS.EDIT_MODE.STIM_TARGET_PARAMS:
    return <TargetIcon fontSize="large" className={classes.icon}/>
  case WIDGETS_IDS.EDIT_MODE.SIM_CONFIG:
    return <CogsIcon fontSize="large" className={classes.icon}/>
  case WIDGETS_IDS.EDIT_MODE.ANALYSIS:
    return <SliderHIcon fontSize="large" className={classes.icon}/>
  case WIDGETS_IDS.EXPLORE_MODE.PYTHON_CONSOLE_EXPLORE:
  case WIDGETS_IDS.EDIT_MODE.PYTHON_CONSOLE_EDIT:
    return <CodeIcon fontSize="large" className={classes.icon}/>
  case WIDGETS_IDS.EXPLORE_MODE.CONNECTION_PLOT:
    return <ConnectivityPlotIcon fontSize="large" className={classes.icon}/>
  case WIDGETS_IDS.EXPLORE_MODE.D2_NET_PLOT:
    return <PopulationIcon fontSize="large" className={classes.icon}/>
  case WIDGETS_IDS.EXPLORE_MODE.GRAGER_PLOT:
    return <GrangerPlotIcon fontSize="large" className={classes.icon}/>
  case WIDGETS_IDS.EXPLORE_MODE.LFP_PSD_PLOT:
    return <LFPPSDPlotIcon fontSize="large" className={classes.icon}/>
  case WIDGETS_IDS.EXPLORE_MODE.LFP_LOCATION_PLOT:
    return <LFPLocPlotIcon fontSize="large" className={classes.icon}/>
  case WIDGETS_IDS.EXPLORE_MODE.LFP_SPECTROGRAM_PLOT:
    return <LFPSpectrogramPlotIcon fontSize="large" className={classes.icon}/>
  case WIDGETS_IDS.EXPLORE_MODE.LFP_TIMESERIES_PLOT:
    return <LFPTimeSeriesPlotIcon fontSize="large" className={classes.icon}/>
  case WIDGETS_IDS.EXPLORE_MODE.RASTER_PLOT:
    return <RasterPlotIcon fontSize="large" className={classes.icon}/>
  case WIDGETS_IDS.EXPLORE_MODE.RATE_PSD_PLOT:
    return <RatePSDPlotIcon fontSize="large" fill={selected ? primaryColor : 'white'} className={classes.icon}/>
  case WIDGETS_IDS.EXPLORE_MODE.RXD_CONCENTRATION_PLOT:
    return <RxDPlotIcon fontSize="large" className={classes.icon}/>
  case WIDGETS_IDS.EXPLORE_MODE.SHAPE_PLOT:
    return <ShapePlotIcon fontSize="large" className={classes.icon}/>
  case WIDGETS_IDS.EXPLORE_MODE.SPIKE_PLOT:
    return <SpikeHistogramPlotIcon fontSize="large" fill={selected ? primaryColor : 'white'} className={classes.icon}/>
  case WIDGETS_IDS.EXPLORE_MODE.SPIKE_STATS_PLOT:
    return <SpikeStatsPlotIcon fontSize="large" fill={selected ? primaryColor : 'white'} className={classes.icon} className={classes.icon}/>
  case WIDGETS_IDS.EXPLORE_MODE.TRACES_PLOT:
    return <CellTracesPlotIcon fontSize="large" className={classes.icon}/>
  case WIDGETS_IDS.EXPLORE_MODE.MORPHOLOGY:
    return <MorphologyPlotIcon fontSize="large" className={classes.icon}/>
  default:
    return <AdjustIcon fontSize="large" className={classes.icon}/>
  }
}


